import time
import pyautogui
import FreeSimpleGUI as gui
import sys
import os

version = "0.2.1"

_C_BUTTON_ = b""
# _C_LOGO_ = b''
_C_AA_LOGO_ = b''
_C_LOGO_ = b""
_V_SCAN_ = ""
count_m = 0

def dumpToFile(_V_SCAN_=_V_SCAN_):
    with open('temp.log', 'w+') as last_scan:
        last_scan.write(_V_SCAN_)
        last_scan.close()


def loadFromFile(_V_SCAN_=_V_SCAN_):
    try:
        print("Loading file...")
        with open('temp.log', 'r') as last_scan:
            _V_SCAN_ = last_scan.read()
            last_scan.close()
        return _V_SCAN_
    except:
        print("File Not Found")
        return ""


def message_window(message, button_name, keep_alive=True):
    layout = [
        [gui.Text(f"{message}",
                  text_color='orange',
                  background_color='white')],
        [gui.Button(f"{button_name}",
                    border_width=0,
                    image_data=_C_BUTTON_,
                    enable_events=True,
                    key="close")]
    ]
    window = gui.Window("Alert",
                        layout=layout,
                        background_color='white',
                        button_color=('orange', 'white'),
                        icon=_C_LOGO_,
                        keep_on_top=keep_alive,
                        no_titlebar=True,
                        grab_anywhere=True)
    while True:
        events, extra = window.Read()
        print(events)
        if events == "close":
            break
    window.Close()


def popupButton():
    layout = [
        [gui.Text("Click 'Close' when ready!",
                  text_color='orange',
                  background_color='white')],
        [gui.Button("CLOSE",
                    image_data=_C_BUTTON_,
                    border_width=0,
                    enable_events=True)]
    ]
    win = gui.Window("", layout=layout, background_color='white', button_color=('orange', 'white'), border_depth=0,
                     keep_on_top=True, icon=_C_LOGO_)
    events, values = win.Read()
    if events == "CLOSE":
        win.Close()


def split_list(list_data, char="\n"):
    new_list = list_data.split(char)
    return_list = [item for item in new_list if item != '']
    return return_list


def generic_scanner(scan_material, delay, enable_popup):
    scan_len = len(scan_material)
    for int_item in range(scan_len):
        time.sleep(delay)
        pyautogui.typewrite(f"{scan_material[int_item]}\n")
        if enable_popup:
            popupButton()
        else:
            pass


def test_window():
    global _V_SCAN_
    layout = [
        [gui.Multiline(default_text=_V_SCAN_,
                       size=(60, 5),
                       key='multi_key',
                       disabled=False)],
        [gui.ProgressBar(0,
                         key='main_bar',
                         size=(53, 10),
                         bar_color=('green', 'white'))],
        [gui.Button("SCAN",
                    image_data=_C_BUTTON_,
                    border_width=0),
         gui.Text("Popup Between Scans",
                  text_color='orange',
                  background_color='white'),
         gui.Spin((False, True)),
         gui.Text("Delay (seconds)",
                  background_color='white',
                  text_color='orange'),
         gui.Spin([i for i in range(10)]),
         gui.Button("PAUSE",
                    image_data=_C_BUTTON_,
                    key='pause',
                    border_width=0)]
    ]

    window = gui.Window(f"Scanner {version}",
                        layout=layout,
                        background_color='white',
                        button_color=('orange', 'white'),
                        icon=_C_LOGO_,
                        ttk_theme='vista')
    p_bar_update = window.find_element('main_bar')
    c_multiline = window.find_element("multi_key")
    # pause_me = window.find_element('pause').
    while True:
        events, values = window.Read(timeout=100)
        print(events, values)
        print(events is None)
        print(values is None)
        if events is None:
            window.Close()
            sys.exit(0)
        _V_SCAN_ = values['multi_key']
        dumpToFile(_V_SCAN_)
        if events == "SCAN":
            c_multiline.Update(disabled=True)
            message_window(message="First scan will occur after you click 'CLOSE'", button_name="CLOSE")
            # generic_scanner(split_list(values[0]), enable_popup=values[1], delay=values[2])
            scan_material = split_list(values['multi_key'])
            scan_len = len(scan_material)
            global count_m
            count = 0 if count_m < 1 else count_m if count_m < scan_len else 0
            print(f"cout_m: {count_m}")
            p_bar_update.update_bar((scan_len - count), max=scan_len)
            for int_item in range(scan_len):
                time.sleep(values[1])
                state, unused = window.Read(timeout=100)
                print(state)
                paused = True if state == 'pause' else False
                if paused:
                    count_m = count
                    print(f"cout_m: {count_m}")
                    break
                pyautogui.typewrite(f"{scan_material[count]}\n")
                count += 1
                p_bar_update.update_bar(count, max=scan_len)
                if values[0]:
                    popupButton()
                else:
                    pass
                if count == scan_len:
                    count = 0
                    count_m = 0
                    break
            c_multiline.Update(disabled=False)
        else:
            pass


while True:
    try:
        _V_SCAN_ = loadFromFile().strip("\n")
        test_window()
        os.remove("temp.log")
        sys.exit()
    except SystemExit:
        os.remove("temp.log")
        sys.exit()
    except:
        message_window("Application Crashed! Progress was saved and will be reloaded...", button_name="RELOAD")
        dumpToFile(_V_SCAN_)
